  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Erie National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1960. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes Refuge visitors,
  Refuge participation, and hunting. Items of interest and photographs are attached.\",\n\t\"owner_org\":
